import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import SubirContenido from "./components/SubirContenido";
import VerProyecto from "./components/VerProyecto";
import Expositores from "./components/Expositores";
import CrearExpositor from "./components/CrearExpositor";

function App() {
    return (
        <Router>
            <div>
                <h1>Galería de Proyectos</h1>
                <Routes>
                    {/* Ruta para subir contenido */}
                    <Route path="/subir" element={<SubirContenido />} />

                    {/* Ruta para ver un proyecto específico */}
                    <Route path="/proyecto/:id" element={<VerProyecto />} />

                    {/* Ruta para listar expositores */}
                    <Route path="/expositores" element={<Expositores />} />

                    {/* Ruta para crear un nuevo expositor */}
                    <Route path="/crear" element={<CrearExpositor />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
